import React from 'react'
import { Container } from 'react-bootstrap';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import './NavigationFooter.css';
import { FaHome } from 'react-icons/fa';
import { AiFillInfoCircle } from 'react-icons/ai';
import { BsFillPostcardFill } from 'react-icons/bs';

function NavigationFooter() {
  return (
    <div>
      <Navbar className='navigation__footer' bg="dark" variant="dark">
        <Container>
          <Nav className="d-flex flex-column">
            <Nav.Link href="#home"><FaHome/><span>Home</span></Nav.Link>
            <Nav.Link  href="#about"><AiFillInfoCircle/><span>About</span></Nav.Link>
            <Nav.Link  href="#project"><BsFillPostcardFill/><span>About</span></Nav.Link>
            <Nav.Link  href="#services">Services</Nav.Link>
            <Nav.Link  href="#contact">Contact</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </div>
  )
}

export default NavigationFooter
